INSERT INTO `componentproperty` VALUES ('INC', 'Interchangeability Code.\n1 One-way-interchangeability:The old part number may be used as a replacement only where the old part number was installed. The new part number is an acceptable replacement for either the old or new part number.\n2 Two-way-interchangeability:The old and new part numbers are both acceptable replacements for either the old or new part number.\n3 Non Interchangeable.\n4 Interchangeable as a set:The part may be one-way or two-way interchangeable as a set. Refer to the Interchangeability Condition Document (ICD).\n5 Qualified Interchangeability:One-way interchangeable parts may be conditionally two-way interchangeable. Non-interchangeable parts may be conditionally one-way or two-way interchangeable. Please refer to the ICD.\n6 Part reidentification:A new part number has been given to a part that is in no other way different from the original one. The parts are fully interchangeable.', '');
