INSERT INTO `componentproperty` VALUES ('RRI', 'Removal Rate Indicator.Indicates the exponential factor to the power of ten applied to the Mean Time/Cycles, Time/Hours or Time/Landings Between Unscheduled Removals (i.e., MTBUR x 10^RRI).', '');
INSERT INTO `componentproperty` VALUES ('SCR', 'Scrap Rate.Identifies the percentage (to one decimal place) of the units removed from service which are expected to be scrapped. For example, \'999\' in the RSPL corresponds to 99.9%.', '');
INSERT INTO `componentproperty` VALUES ('SPC', 'Spare Class Code.Indicates the classification of the spare part as follows:\n0 Reference item;\n1 Expendable;\n2 Repairable with dedicated CMM;\n6 Repairable without dedicated CMM.', '');
INSERT INTO `componentproperty` VALUES ('TCC', 'Time Cycle Code.Indicates that the MTBUR is shown in:\nH Hours\nC Cycles\nL Landings', '');
